import React from "react";

export class States extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      united: false,
    };
  }

  setUnited = () => {
    this.setState({ united: !this.state.united });
    console.log(this.state.united);
  };

  render() {
    return (
      <>
      <button type="button" onClick={this.setUnited}>Click</button>
        <div className="status">
          {this.united ? "Code for everyone" : "Make America code again"}
        </div>
      </>
    );
  }
}
